import logo from '../assets/images/Logo.png';
import Profil from '../assets/images/Profil.png';
import product1 from '../assets/images/products/product-1.png';
import product2 from '../assets/images/products/product-2.png';
import car1 from '../assets/images/products/car1.png'
import car2 from '../assets/images/products/car2.png'
import car3 from '../assets/images/products/car3.png'
import car4 from '../assets/images/products/car4.png'

export default {
    logo,
    Profil,
    product1,
    product2,
    car1,
    car2,
    car3,
    car4,
};
